'use strict'
const FlakeId = require('flake-idgen')
const biguint = require('biguint-format')
const crypto = require('crypto')
const _ = require('lodash')
const flakeId = new FlakeId({ id: process.pid & 0xF, epoch: 1600000000000 })

exports.snakeCaseObject = function (obj){
  return _.fromPairs(_.map(_.toPairs(obj), i => [_.snakeCase(i[0]), i[1]]))
}

exports.createCertificate = function (){
  const attributes = [{ name: 'commonName', value: 'localhost' }]
  const sans = [
    {
      // type 2 is DNS
      type: 2,
      value: 'localhost'
    },
    {
      type: 2,
      value: 'localhost.localdomain'
    },
    {
      type: 2,
      value: '*.dev'
    },
    {
      type: 2,
      value: '[::1]'
    },
    {
      // type 7 is IP
      type: 7,
      ip: '127.0.0.1'
    },
    {
      type: 7,
      ip: 'fe80::1'
    },
    {
      // type 7 is IP
      type: 7,
      ip: '0.0.0.0'
    }
  ]
  const options = {
    algorithm: 'sha256',
    days: 30,
    keySize: 2048,
    extensions: [
      // {
      //   name: 'basicConstraints',
      //   cA: true,
      // },
      {
        name: 'keyUsage',
        keyCertSign: true,
        digitalSignature: true,
        nonRepudiation: true,
        keyEncipherment: true,
        dataEncipherment: true
      },
      {
        name: 'extKeyUsage',
        serverAuth: true,
        clientAuth: true,
        codeSigning: true,
        timeStamping: true
      },
      {
        name: 'subjectAltName',
        altNames: sans
      }
    ]
  }
  return require('selfsigned').generate(attributes, options)
}

// 生成53位雪花id
exports.flakeId = function (){
  const id = flakeId.next()
  const buf = Buffer.alloc(8)
  // 4 bit worker + 12 bit counter
  buf.writeUInt16BE(id.readUInt16BE(6), 6)
  // drop 5 bit time + 5 bit datacenter + 1 bit worker
  buf.writeUInt32BE(id.readUInt32BE(0) >> 3, 1)
  return _.toInteger(biguint(buf, 'dec'))
}

let demoAuthLock = 0
exports.demoAuth = async function (sk, time, sha1) {
  if (!sha1) return false
  if (Math.abs(Date.now() - (time || 0)) > 1000 * 60 * 5) return false

  if (demoAuthLock > 10) return false
  demoAuthLock += 1
  await new Promise(resolve => setTimeout(resolve, 100))
  demoAuthLock -= 1

  const str = `${time}:${sk}:${time}`
  const hash = crypto.createHash('sha1')
  hash.write(str)
  const dsha1 = hash.digest('hex')
  return sha1 === dsha1
}

